import { OAuthName } from './types.js';

const OAuthNameText = {
    [OAuthName.OK]: 'OK',
    [OAuthName.MAIL]: 'Mail.ru',
    [OAuthName.VK]: 'VK ID'
};

export { OAuthNameText };
